import React from 'react';

const Movie = (props) => {

    const onClickHandler = () => {
        props.delMovie(props.movie.id);
        console.log(`delete`, props.movie.id);
    };

    return(
        <li>
            <span>
            {props.movie.title}
            </span>
            <span>
            {props.movie.genre}
            </span>
            <button onClick={onClickHandler}>Delete</button>
        </li>
    );
}

export default Movie;
